;; **
;;; ### (a)
;;; t: 		Time in months  
;;; R(t):	Amount of rabbits during that time  
;;; F(t):	Amount of foxes during that time  
;;; dR/dt:	Function of new rabbits given current rabbits and foxes for that time  
;;; dF/dt:	Function of new foxes given current rabbits and foxes for that time
;; **

;; @@
(defn Rt
  "Function of new Rabbits given Foxes"
  [R F]
  (- (* (* 0.1 R) (- 1 (/ R 10000)))
     (* (* 0.005 R) F)))

(defn Ft
  "Function of new Foxes given Rabbits"
  [R F]
  (- (* (* 0.00004 R) F)
     (* 0.04 F)))
;; @@

;; **
;;; ### (b)
;; **

;; @@
(defn RabbitFoxModel
  "Euler's Method applied to Rabbits and Foxes over time"
  [Rinitial Finitial tInitial tFinal deltaT]
  (let [numberOfSteps (/ (- tFinal tInitial) deltaT)]
    (loop [i 1
           R Rinitial
           F Finitial
           t tInitial]
      (if (> i numberOfSteps)
        {:deltaT (float deltaT), :t (float t), :rabbits (float R), :foxes (float F)}
        (recur (inc i)
               (+ R (* (Rt R F) deltaT))
               (+ F (* (Ft R F) deltaT))
               (+ t deltaT))))))

(defn successive-approximation
  "decreases deltaT over time till minimum deltaT before error"
  [Rinitial Finitial tInitial tFinal deltaT]
  (loop [deltaT deltaT
         results []]
    (if-not (< deltaT (/ 1 100000))
      (recur (/ deltaT 10)
             (conj results (RabbitFoxModel Rinitial Finitial tInitial tFinal deltaT)))
      (do (println "deltaT \t| R(" tFinal ") \t| F(" tFinal ")")
        (println "_____________________________________")
        (dotimes [i (count results)]
          (println (:deltaT (nth results i)) "\t|" (:rabbits (nth results i)) "\t|" (:foxes (nth results i))))))))
;; @@

;; @@
(successive-approximation 2000 10 0 100 1)
