;; **
;;; R(100) ~ 1286.97  
;;; F(100) ~ 11.667  
;;; 
;;; Unfortunatly to be more prescise I risk locking up the program in a really large loop.
;; **

;; **
;;; ### (c)
;; **

;; @@
(defn RabbitFoxModelPlot
  "plot only function"
  [Rinitial Finitial tInitial tFinal deltaT]
  (let [numberOfSteps (/ (- tFinal tInitial) deltaT)
        getLess (int (/ (- tFinal tInitial) (* deltaT 100)))]
    (loop [i 1
           R Rinitial
           F Finitial
           t tInitial
           datapointsR []
           datapointsF []
           datapointst []]
      (if (> i numberOfSteps)
        (list (plot/list-plot (take-nth getLess datapointsR) :joined true :color "gray")
              (plot/list-plot (take-nth getLess datapointsF) :joined true :color "red"))
        (let [t (+ t deltaT)
              newR (+ R (* (Rt R F) deltaT))
              newF (+ F (* (Ft R F) deltaT))]
          (recur (inc i)
                 newR
                 newF
                 t
                 (conj datapointsR newR)
                 (conj datapointsF newF)
                 (conj datapointst t)))))))
;; @@

